import React, { useContext, useState } from "react";
import './login.css';
import Swal from 'sweetalert2'
import Cookies from 'universal-cookie';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import api from "../../api/api";
// assets
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import KeyIcon from '@mui/icons-material/Key';

import FormControl from '@mui/material/FormControl';
import InputLabel from '@mui/material/InputLabel';
import Input from '@mui/material/Input';
import AccountCircle from '@mui/icons-material/AccountCircle';
import Header from '../Components/Header';


import {
    IconButton,
    InputAdornment
} from '@mui/material';
import { AuthContext } from "../../Context/AuthContext";
import { useNavigate } from "react-router-dom";
let timerInterval

//Cookies para mantener el token de la sesion
const cookies = new Cookies();

const Login = () => {

    const navigate = useNavigate();
    const { error, login } = useContext(AuthContext);



    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [showPassword, setShowPassword] = useState(false);

    const handleClickShowPassword = () => {
        setShowPassword(!showPassword);
    };

    const handleMouseDownPassword = (event) => {
        event.preventDefault();
    };
    //Submit
    const authSubmitHandler = async event => {
        event.preventDefault();
        try {

            const user = { email, password }

            try {

                await login(user)

                /*Swal.fire({
                    icon: 'success',
                    iconHtml: '<img src="https://www.easy-gst.in/wp-content/uploads/2017/07/success-icon-10.png" alt="Icono personalizado" width="98">',
                    title: "Welcome!!!",
                    showConfirmButton: false,
                    timer: 1500
                })*/

                // navigate('/local');

            } catch (error) {

                /* Swal.fire({
                     icon: 'error',
                                     iconHtml: '<img src="https://cdn.icon-icons.com/icons2/317/PNG/512/sign-error-icon_34362.png" width="125">',

                     title: "Error",
                     showConfirmButton: false,
                     timer: 1500
                 })*/

            }

        } catch (err) {


        }
    };

    return (
        <>
            <Header />
            <div className="Auth-form-container">
                <Form className="Auth-form">
                    <div className="Auth-form-content">
                        <h3 className="Auth-form-title">Ingresar</h3>
                        <FormControl variant="standard" sx={{ m: 1, width: '100%' }}>
                            <InputLabel className="label-auth" htmlFor="input-with-icon-adornment">
                                Correo electrónico
                            </InputLabel>
                            <Input
                                id="input-with-icon-adornment"
                                type="email"
                                startAdornment={
                                    <InputAdornment position="start">
                                        <AccountCircle />
                                    </InputAdornment>
                                }
                                onChange={(e) => setEmail(e.target.value)}
                            />
                        </FormControl>

                        <FormControl sx={{ m: 1, width: '100%' }} variant="standard">
                            <InputLabel htmlFor="outlined-adornment-password">Password</InputLabel>
                            <Input
                                id="outlined-adornment-password"
                                type={showPassword ? 'text' : 'password'}
                                onChange={(e) => setPassword(e.target.value)}
                                startAdornment={
                                    <InputAdornment position="start">
                                        <KeyIcon />
                                    </InputAdornment>
                                }
                                endAdornment={
                                    <InputAdornment position="end">
                                        <IconButton
                                            aria-label="toggle password visibility"
                                            onClick={handleClickShowPassword}
                                            onMouseDown={handleMouseDownPassword}
                                            edge="end"
                                        >
                                            {showPassword ? <VisibilityOff /> : <Visibility />}
                                        </IconButton>
                                    </InputAdornment>
                                }
                                label="Password"
                            />
                        </FormControl>

                        <div className="d-grid gap-2 mt-3">
                            <button onClick={authSubmitHandler} className="main-button">
                                Ingresar
                            </button>
                        </div>

                        <p className="forgot-password text-right mt-2">
                            ¿Olvidaste tu <a href="#">contraseña?</a>
                        </p>
                    </div>
                </Form >
            </div >
        </>
    )
}
export default Login
